import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Analisi Sicurezza Password</h1>
      <fieldset>
        <legend>Caratteristiche</legend>
        <label>
          <input
            type="checkbox"
            name="caratt_speciali"
            checked={carattSpeciali}
          />
          Caratteri Speciali
        </label>
        <label>
          <input
            type="checkbox"
            name="maiuscole"
            checked={maiuscole}
          />
          Maiuscole
        </label>
        <label>
          <input
            type="checkbox"
            name="numeri"
            checked={numeri}
          />
          Numeri
        </label>
      </fieldset>
      <input className="input_normale" type="number" placeholder='Lunghezza' />
      <button>Calcola</button>
    </div>
  );
}

export default App;
